import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBell, faEnvelope } from '@fortawesome/free-solid-svg-icons';
import logo from '../../uss.png'; // Adjust the path to point to the root directory

function AppHeader() {
    return (
        <div className="AppHeader">
            <img src={logo} alt="logo" style={{ height: '100px' }} />
            <h1>Sneha</h1>
            <div style={{ marginLeft: 'auto' }}>
                <FontAwesomeIcon icon={faBell} style={{ marginRight: '20px', cursor: 'pointer', fontSize: '24px' }} />
                <FontAwesomeIcon icon={faEnvelope} style={{ marginRight: '10px', cursor: 'pointer', fontSize: '24px' }} />
            </div>
        </div>
    );
}

export default AppHeader;
